import React from "react";
import { NavLink } from "react-router-dom";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";

const Services = () =>{
    return(
        <>
        <section classNameName="services">
        <div classNameName="container">
            <div classNameName="row">
                <div classNameName="col-md-6 col-lg-12 mx-auto ">
                <div className="card " style={{width: "18rem", border: "2px", borderStyle: "solid"}}>
                    <img src="https://picsum.photos/200/300" className="card-img-top" alt="logo"  width="50px" height="200px"/>
                    <div className="card-body">
                      <h5 className="card-title">Card title</h5>
                      <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                      <NavLink to="#" className="btn btn-primary">Go somewhere</NavLink>
                    </div>
                </div>



                </div>
            </div>
        </div>

        </section>

        </>
    )
}

export default Services;
